('rll@cwilson.com', NULL, '900-885 West Georgia Street', 'Vancouver', 'British Columbia', 'select state', 'V6C 3H1', '604-891-7734', '604-687-6314', 'Rong_Liang.jpg', 'Liang', '', 'http://www.cwilson.com', NULL, NULL, 'Lauren is an associate with the firm''s Estate & Trust Litigation, Wealth Preservation, Strata, and Insurance Groups.\r\n\r\nLauren represents individual and institutional clients in wills related disputes, estate administration, committeeship appointments, strata disputes, commercial lease disputes, insurance claims and collection matters, and has assisted in cases at all levels of Court in British Columbia.\r\n\r\nLauren received her first Bachelor of Arts Degree from a Chinese university in 1997, and her second Bachelor of Arts Degree in 2004 from the University of British Columbia. She studied law at the University of British Columbia, receiving several academic scholarships and earning her Juris Doctor degree in 2009.\r\n\r\nLauren grew up and was educated in the People''s Republic of China. She speaks, reads and writes Mandarin Chinese fluently and has extensive business experience in China. She was called to the Bar of British Columbia in May 2010.\r\n', 'Chinese Bio Coming Soon', 'Clark Wilson LLP', 'L1015', '', NULL, NULL, 'Rong', NULL, 'North Vancouver', 'Burnaby', 'Richmond', 'New Westminster', 'Lions Bay', 'Gibsons', 'White Rock', 'Walnut Grove', 'Blaine', 'Birch Bay', 'Custer', '', '', '', '', 'Canada', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2015-11-05 14:16:22', '2015-11-05 19:22:51'),
('tuckman4@msn.com', NULL, '120 Maple Street', 'San Francisco', 'California', 'California', '94110', '415-878-1500', '415-878-1577', 'Chinese_Lawyer.jpg', 'Chang', '', 'http://www.hispaniclawyersnetwork.com', NULL, NULL, 'I Love Chinese Clients', 'I love Chinese Clients', 'Chang & Lee Personal Injury Law', 'L1006', '', NULL, NULL, 'Stanley ', NULL, 'Concord', 'Bakersfield', 'Chula Vista', 'Los Angeles', 'San Diego', 'Stockton', 'Merced', 'San Bernardino', 'Sacramento', 'San Jose', 'Oakdale', 'Orange', 'Redwood City', 'Daly City', 'Hayward', 'USA', NULL, 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '2015-10-27 23:08:01', '2015-10-30 10:10:26'),
('awlu@mintz.com', NULL, '666 Third Avenue', 'New York', 'New York', 'New York', '10017', '212-692-6857', '212-983-3115', 'Amy_Lu.jpg', 'Lu', '', 'http://www.mintz.com', NULL, NULL, 'Amy’s practice involves all aspects of commercial real estate transactions. Her experience includes the acquisition, disposition and development of office, retail and mixed-use properties, joint ventures, and office, retail, ground and data center leasing, from both landlord and tenant positions. \r\n\r\nBefore joining Mintz Levin, Amy served as an executive director in the legal and compliance division of a global financial services firm where she handled transactions relating to the development, design and construction and leasing of the institution’s real estate portfolio in the Americas, Asia Pacific and Europe, Middle East and Africa. Amy also practiced as an associate in the real estate group of another prominent New York law firm representing developers, owners, investors, and financial institutions on a wide range of complex real estate projects.\r\n\r\nAmy is committed to providing pro bono services and has represented numerous non-for-profit and charitable organizations.   \r\n', '', 'Mintz Levin, PC', 'L1008', '', NULL, NULL, 'Amy W.', NULL, 'Queens', 'Flushing', 'Brooklyn', 'Bayside', 'Elmhurst', 'Douglaston', 'Little Neck', 'Bensonhurst', 'Coona', 'Woodside', 'Floral Park', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2015-11-03 23:17:17', '2015-11-04 04:30:59'),
('achan@ahchanlaw.com', NULL, '805 West Duarte Road', 'Arcadia', 'California', 'California', '91007', '626-821-9094', '626-821-8746', 'Alfred_Chan.jpg', 'Chan', '', 'http://www.ahchanlaw.com', NULL, NULL, 'At the A.H. CHAN LAW FIRM, PC, our results-driven approach is based on two pillars: dedication and integrity.\r\n\r\nWe care about our clients and hold their best interests paramount. In practice, that means we are unrelenting in our pursuit of creative problem resolution and always keep customer service firmly in mind. We always return phone calls promptly and keep our clients fully informed and updated.\r\n \r\n\r\nWe are dependable and honest. We pride ourselves on our integrity and seek to provide our clients with the most realistic picture and honest assessment of the situation. This allows us to work toward timely and effective results. It is our belief that a clear understanding of the client''s situation and objectives are essential to properly provide and advise with cost-effective, innovation and practical solutions to achieve client''s goals.\r\n\r\nWe encourage you to get in touch and schedule an appointment.\r\n\r\n\r\nWe are open from 9 a.m. to 5:30 p.m., Monday through Friday, and are available for after-hours, weekend and off-site meetings by appointment.\r\n\r\nOur lawyer and team offer free initial consultations and work on contingency on all personal injury cases and waivable consultation fees for clients who end up retaining counsel. Our attorneys speak Mandarin and Cantonese, and we accept Visa and MasterCard.\r\n\r\nTo schedule an initial consultation to discuss California legal issues with our Arcadia attorney, call 626-821-9094 \r\n', 'Chinese Bio Coming Soon', 'A.H. Chan Law Firm, PC', 'L1046', 'Suite 106', NULL, NULL, 'Alfred H.', NULL, 'San Gabriel', 'Alhambra', 'Temple City', 'Pasadena', 'Los Angeles', 'Rosemead', 'Montebello', 'Monterey Park', 'South Pasadena', 'El Monte', 'Monrovia', 'Rowland Heights', 'Hacienda Heights', 'Walnut', 'West Covina', 'USA', NULL, 'Y', '', '', '', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-02-03 22:55:47', '2017-02-02 21:48:46'),
('mail@lehmanlaw.com', NULL, 'Unit A3-301, Shanghai 800 - Show', 'Shanghai', 'select state', 'China', '200040', '(86) (21) 6182 6858', '86 21 6182 6752', 'Peter_Chen.jpg', 'Chen', '', 'http://www.lehmanlaw.com', NULL, NULL, 'Lehman, Lee & Xu''s Shanghai office is our largest office in China, managed by a core group of foreign and Chinese-licensed attorneys. Our Shanghai office has grown rapidly since being established in 1996. LEHMAN, LEE & XU was ranked first in the Global Counsel 3000 rankings of all domestic law firms in China in 2006 (8th among all foreign and domestic firms in China) in recognition of our capabilities across all major practice areas. ', '', 'Lehman, Lee & Xu', 'L1018', '800 Chang De Road, Jingan District', NULL, NULL, 'Peter', NULL, 'Chengdu', 'Fuzhou', 'Harbin', 'Hong Kong', '', '', '', '', '', '', '', '', '', '', '', 'China', NULL, '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2015-11-05 21:37:35', '2015-11-06 02:56:15'),
('ybailey@duanemorris.com', NULL, '1540 Broadway', 'New York', 'New York', 'New York', '10036', '212-692-1084', '212-214-0308', 'Yao_bailey.jpg', 'Bailey', '', 'http://www.duanemorris.com', NULL, NULL, 'Yao Bailey focuses her real estate practice on commercial leasing, commercial and residential acquisitions and construction contracts. Her clients include owners, architects and contractors, as well as cooperative and condominium boards. Bailey also advises clients on state architecture licensing, the establishment and operation of various types of corporate entities and their organizational documents and certain related employment and immigration matters.\r\n\r\nA native speaker of Mandarin, Bailey was previously a practicing lawyer in China. Admitted to practice law in New York since 1999, she assists U.S. architectural firms in establishing their Chinese operations, negotiating design contracts with Chinese owners and registering trademarks in China. She also represents Chinese clients in the U.S. in connection with real estate purchases and commercial leasing.\r\n\r\nBailey earned her LL.M. in Asian and Comparative Law from the University of Washington School of Law, and she received her LL.B. in international economic law from Peking University School of Law in Beijing. She often presents seminars and workshops on real estate, construction and architectural law.\r\n', 'Chinese Bio Coming Soon', 'Duane Morris LLP', 'L1009', '', NULL, NULL, 'Yao', NULL, 'Queens', 'Flushing', 'Brooklyn', 'Bayside', 'Elmhurst', 'Douglaston', 'Little Neck', 'Bensonhurst', 'Corona', 'Woodside', 'Floral Park', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2015-11-03 23:23:10', '2015-11-04 04:28:20'),
('ggou@bhlawpllc.com', NULL, '110 West Fayette Street', 'Syracuse', 'New York', 'New York', '13202', '315-701-6327', '315-423-2807', 'gwen_gou.jpg', 'Gou', '', 'http://www.bhlawpllc.com', NULL, NULL, 'Gwen Gou is a graduate of Cornell Law School and practices as an Associate Attorney in the Business Transactions and Taxation Department.\r\n\r\nAt Cornell Law School, Gwen was selected onto the External/International Moot Court Competition Team for two consecutive years and participated in national moot court competitions on behalf of the School. Gwen was also an elected Board Member of the Cornell Law School Journal of Law and Public Policy. During law school, Gwen served as a Teaching Assistant to Professor David Funk, Director of Cornell University’s Baker Program in Real Estate, in the graduate-level Real Estate Transaction and Deal Structuring class. She is also an active member of Cornell University’s Associate Real Estate Council.\r\n\r\nGwen graduated from Washington University in St. Louis with majors in economics and mathematics. She was an Eliot Scholar of Washington University.\r\n\r\nGwen is a native speaker of Mandarin. She volunteered with the St. Louis Family Court Mentoring Program during college and Catholic Charities of the Archdiocese of Newark – Immigration Services during law school.  A resident of the City of Syracuse,  she enjoys activities on the lakes and hiking the trails of Upstate New York.\r\n', 'Chinese Bio Coming Soon', 'Bousquet Holstein, PLLC', 'L1010', 'Suite 900', NULL, NULL, 'Gwen Z.', NULL, 'Fairmont', 'Auburn', 'Fulton', 'Cortland', 'Watertown', 'Utica', 'Ithaca', 'Rome', 'Oswego', 'East Syracuse', 'Split Rock', 'Taunton', 'New York', 'Queens', 'Flushing', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 