('jcliu@jonesday.com', NULL, '555 California Street', 'San Francisco', 'California', 'California', '94104', '415-875-5842', '415-875-5700', 'Joe_Liu.jpg', 'Liu', '', 'http://www.jonesday.com', NULL, NULL, 'Joe Liu practices intellectual property law, with a focus on patent litigation. His experience also includes representing clients in the procurement of intellectual property rights before the U.S. Patent and Trademark Office. With a background in electrical engineering, Joe has represented clients involved in various technologies, including semiconductors, networking devices, mechanical systems, communications systems, and biomedical devices.\r\n\r\nPrior to practicing law, Joe developed extensive experience in the fields of finance and business management. His business experience includes trading stock options on the floor of the American Stock Exchange. \r\n', 'Chinese Bio Coming soon', 'Jones Day', 'L1011', '26th FL', NULL, NULL, 'Joe C.', NULL, 'Alameda', 'Berkeley', 'Concord', 'Daly City', 'Fremont', 'Hayward', 'Mountain View', 'Napa', 'Oakland', 'Petaluma', 'Pittsburg', 'Pleasanton', 'Redwood City', 'Richmond', 'San Jose', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2015-11-03 23:39:05', '2015-11-04 04:45:26'),
