('hfakhimi@lawhf.com', NULL, '3 Hudson Center Drive', 'Santa Ana', 'California', 'California', '92707', '714-542-2188', '', 'Houman_Fakhimi_-_Criminal.jpg', 'Fakhimi', '', 'http://www.law2188.com', NULL, NULL, 'Houman Fakhimi, the founding partner of the Criminal Defense Team, has amassed deep expertise in the area of criminal defense law thanks to years of experience. He oversees all litigation carried out by the firm, and he has demonstrated mastery in a variety of relevant legal domains. He’s an alumnus of the University of California, Irvine and Whittier Law School. In addition to being an active member of the State Bar of California’s Criminal Section, Mr. Fakhimi also boasts accreditations in The Association of Federal Defense Attorneys, the California Attorneys for Criminal Justice, and the California Public Defenders Association. His results-oriented practice has represented clients throughout the Southland area, including San Diego, San Bernardino, Los Angeles, Inland Empire, Riverside, and Orange Counties. He’s also done extensive work in the United States District Court. Mr. Fakhimi has handled many high profile matters including, but not limited to: murder and violent crimes, sex crimes, juvenile delinquency, theft, child molestation, and DUI with injury cases. He can both “see the big picture” and zero-in on critical details. He understands the art and science of jury selection, how best to negotiate with prosecutors pretrial, how to ensure a fluid, dynamic interaction with his clients. Thanks to his focus on clients and his intense discipline, Mr. Fakhimi has become one of the most trusted and foremost experts on criminal defense procedure in California. He’s often called on by local media to provide insight into key matters of public interest. Our Los Angeles criminal defense team also utilizes the services of some of the best trained local investigators in the criminal defense field.  \r\n\r\n', 'Chinese Bio Coming Soon', 'Fakhimi & Associates', 'L1024', 'Suite 620', NULL, NULL, 'Houman', NULL, 'Los Angeles', 'Riverside', 'San Bernardino', 'Long Beach', 'Ventura', 'Santa Monica', 'Buena Park', 'Pasadena', 'Garden Grove', 'Huntington Park', 'Newport Beach', 'Huntington Beach', 'San Diego', 'Irvine', 'Aliso Viejo', 'USA', NULL, '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-01-08 00:16:49', '2016-01-12 19:28:10'),
('hfakhimi@lawhf.com', NULL, '3 Hudson Center Drive', 'Santa Ana', 'California', 'California', '92707', '714-542-2188', '', 'Houman_Fakhimi.jpg', 'Fakhimi', '', 'http://www.employmentlawteam.com', NULL, NULL, 'WHY SHOULD YOU CHOOSE THE EMPLOYMENT LAW TEAM™?\r\n\r\nIssues related to labor laws and rights of employees and duties of employers have been front page news in California and other states for the past few years. The internet is inundated with articles about large judgments against major corporations due to not following up state and/or federal laws that pertain to employees. A major reason for these large verdicts is the fact that federal and state laws that deal with many aspects of employer-employer relations are less than clear. Another reason is the sensitive and emotional nature of terminating an employee''s tenure which can in many situations turn into a heated battle. We at the Employment Law Team™ have dealt with many employment law matters and our expertise ranges from drafting and negotiating employment contracts, to advising employers on their statutory and common law obligations such as issues related to age discrimination, violation of FEHA, assisting employers conduct pre-litigation investigation and representing employees who have been denied their rights or mistreated by their employers. Representing both sides of the aisle our attorneys bring a wealth of experience to our clients and have been able to turn that experience and knowledge in judgments and settlements which have kept our clients happy for many years.\r\n', 'Chinese Bio Coming Soon', 'Fakhimi & Associates', 'L1025', 'Suite 620', NULL, NULL, 'Houman', NULL, 'Los Angeles', 'Riverside', 'San Bernardino', 'Long Beach', 'Ventura', 'Santa Monica', 'Buena Park', 'Pasadena', 'Garden Grove', 'Huntington Park', 'Newport Beach', 'Huntington Beach', 'San Diego', 'Irvine', 'Aliso Viejo', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '