('info@manchanda-law.com', NULL, '30 Wall Street', 'New York', 'New York', 'New York', '10005', '212-968-8600', '212-968-8601', 'Rahul_Manchanda.jpg', 'Manchanda', '', 'http://www.manchanda-law.com', NULL, NULL, 'Professor and Attorney Rahul Manchanda worked for one of the largest law firms in Manhattan where he focused on asbestos litigation. At the United Nations Commission on International Trade Law (“UNCITRAL”) in Vienna, Austria, Mr. Manchanda was exposed to international trade law, arbitration, alternative dispute resolution, and comparisons of the American common law with European civil law. He later worked for one of the largest multi-national law firms in Paris France, Coudert Frères, where he focused primarily on international arbitration, arbitration agreements, the enforcement of foreign arbitration awards against multinational parent corporations, piercing the corporate veil, arbitration venue choice, and foreign policy. In Paris, Mr. Manchanda analyzed and compared the American legal system with its British, French, Russian, German, and Chinese counterparts. For further details, information, and a free consultation to see if you qualify, please call our law office at (212) 968-8600, toll free at (855) 207-7660, or email us at info@manchanda-law.com.', 'Chinese Bio Coming Soon', 'Manchanda Law Office, PLLC', 'L1157', '8th FL', NULL, NULL, 'Rahul', NULL, 'Brooklyn', 'Queens', 'Bronx', 'Flushing', 'Elmhurst', 'Bay Ridge', 'Yonkers', 'Bayside', 'Bensonhurst', 'Borough Park', 'Corona', 'Manhattan', 'Sunset Park', 'Whitestone', 'White Plains', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2017-03-29 13:30:09', '2017-05-03 16:54:55'),
