('causeylaw@gmail.com', NULL, '7755 Center Avenue', 'Huntington Beach', 'California', 'California', '92647', '714-372-2225', '714-908-7646', 'Logo_5.jpg', 'Causey', '', 'http://www.hbdivorcelawyer.com', NULL, NULL, 'At the Law Office of Desiree Causey in Huntington Beach, California, we don''t represent just anybody. We are committed to providing our clients with the personal service they deserve as we find solutions to their important legal issues. \r\n\r\nTo schedule your consultation with an attorney, call 714-372-2225. \r\n\r\n\r\nOur lawyer, Desiree Causey, is committed to helping all kinds of families find real solutions to their legal issues. We help military couples deal with divorce and represent same-sex couples in all areas of family law including divorce, child custody and visitation, child support, adoption and domestic partnerships. We also draft and review in vitro fertilization contracts for intended parents. \r\n\r\n\r\nWhen you make the decision to call a lawyer about your important legal issues, you deserve to speak directly to a lawyer, not an associate or paralegal. When you call the Law Office of Desiree Causey, you will get Desiree Causey. She personally responds to all phone calls and e-mails promptly and will keep you up to date about the status of your case. \r\n\r\n\r\nWe can help you find a solution to your legal problem. Contact us today to schedule your consultation. \r\n', 'Chinese Bio Coming Soon', 'The Law Office of Desiree Causey', 'L1153', 'Suite 1100', NULL, NULL, 'Desiree', NULL, 'Irvine', 'Long Beach', 'Santa Ana', 'Newport Beach', 'Garden Grove', 'Tustin', 'Orange', 'Westminster', 'Bellflower', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', 'Y', 'Y', '', '', '', 'Y', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''