('lbui@shbllp.com', NULL, '100 Spectrum Center Drive', 'Irvine', 'California', 'California', '92618', '949-340-3400', '949-340-3000', 'Lynda_Bui.jpg', 'Bui', '', 'http://www.shbllp.com', NULL, NULL, 'Founded in Orange County, California, in 1992, Shulman Hodges & Bastian LLP has evolved to meet the needs of its clients and help address challenges faced in the business community. Today, we offer comprehensive legal solutions to businesses and individuals throughout the country. \r\n\r\nBy assembling a talented group of diverse attorneys, we have expanded to help a wide range of clients in the areas of business organization and transaction, litigation, reorganization and insolvency, real estate, and estate planning.\r\n \r\n\r\nAlthough the size of our firm has grown over the years, we are proud to have maintained an organizational structure with a smaller, more personal feel. Our experienced attorneys are just as accessible as ever to help with all of your legal needs. In fact, everyone at our law firm takes a direct and personal interest in the issues and challenges you or your business is facing.\r\n\r\nOur dedication to excellence and efficiency allows us to give exceptional service to our clients as well as our communities, and we are deeply committed to making a positive impact on both.\r\n\r\n\r\n\r\nOur legal expertise and achievements have given us a strong platform for giving back to the community in many ways. With offices in Irvine and Riverside, we are proud to use our time, talent and resources to make a positive difference in the communities in which we live and work. \r\n\r\n\r\nIf you are seeking experienced legal representation for any legal issue in California or elsewhere, our law firm is here for you. To schedule a consultation with one of our knowledgeable lawyers, please contact us online or by telephone at 949-340-3400 \r\n', 'Chinese Bio Coming Soon', 'Shulman Hodges & Bastian, LLP', 'L1154', 'Suite 600', NULL, NULL, 'Lynda T.', NULL, 'Carlsbad', 'Chula Vista', 'City of Industry', 'Cerritos', 'Diamond Bar', 'Downey', 'El Monte', 'Encinitas', 'Hacienda Heights', 'Long Beach', 'Manhattan Beach', 'Los Angeles', 'Rowland Heights', 'Orange', 'Santa Ana', 'USA', NULL, '', '', '', '', '', '', '', '', '', 'Y', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-03-06 00:06:40', '2017-03-06 05:33:12'),
('marcine@seidlawgroup.com', NULL, '950 Industrial Avenue', 'Palo Alto', 'California', 'California', '94303', '408-271-9888', '', 'Marcine_Seid.jpg', 'Seid', '', 'http://www.seidlawgroup.com', NULL, NULL, 'California immigration lawyer Marcine Seid uses her experience in immigration law and knowledge of governmental agencies'' procedures and practices to assist her clients reach their immigration goals, whether these goals are working in the United States temporarily or obtaining a green card to become a permanent resident. Our law firm is well-known for its H1-B specialty occupation visas and its immigrant labor certification practice.\r\n\r\nTo provide our clients with the most current and cost-effective representation, the Law Offices of Marcine A. Seid keep pace with rapidly changing immigration laws such as the recently implemented labor certification PERM Process. We also maintain close working relationships with the U.S. Citizenship & Immigration Service, the Administrative Appeals Office and the US Department of Labor.\r\n\r\nFor unsurpassed legal representation in the area of Immigration and Naturalization law, contact the Law Offices of Marcine A. Seid to schedule an initial consultation. Our immigration law firm is based in San Jose, California in the heart of Silicon Valley.\r\n\r\n\r\nDiscuss your Visa Needs with a Leading U.S. Immigration Attorney:\r\n Call (408) 271-9888', 'Chinese Bio Coming Soon', 'The Law Offices of Marcine A. Seid', 'L1042', '', NULL, NULL, 'Marcine A.', NULL, 'San Jose', 'San Francisco', 'Redwood City', 'San Mateo', 'Fremont', 'Hayward', 'Burlingame', 'Berkeley', 'Alameda', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-01-29 10:53:08', '2016-01-29 16:02:40'),
('dlinlaw@sbcglobal.net', NULL, '80 S. Lake Avenue', 'Pasadena', 'California', 'California', '91101', '626-792-9688', '', 'David_Lin.jpg', 'Lin', '', 'http://www.dlinlaw.com', NULL, NULL, 'At the Law Offices of David S. Lin, we bring over 20 years of legal experience to the individuals, small businesses and mid-size companies we represent. Known for our experience, professionalism, integrity and ability to resolve even the most difficult cases, our dynamic full-service firm offers high-quality legal assistance in various areas of law. Led by lawyer David S. Lin, we serve clients throughout Northern and Southern California. We also represent international clients in China, Hong Kong and Taiwan. If you are looking for highly experienced Pasadena litigation attorneys who are fully committed to your case and motivated to win, please call our firm at 626-792-9688 or 949-833-7107, or contact us online. When you visit our offices for a free one-hour legal consultation, we will provide you with an honest and thorough assessment of your case and explain your available legal options. If you choose to retain our legal services, we will build and formalize a strong, solid legal strategy designed to help you reach your short-term goals and long-term objectives. For your convenience, we also speak Chinese (Mandarin and Cantonese dialects and Taiwanese.', '&#26519;&#29790;&#24029;&#24459;&#24107;&#20107;&#21209;&#25152;&#30340;&#24459;&#24107;&#22296;&#38538;&#26377;&#30528;&#36817;20&#24180;&#30340;&#27861;&#24459;&#24478;&#26989;&#32147;&#39511;&#65292;&#19968;&#30452;&#20197;&#20358;&#65292;&#25105;&#20497;&#37117;&#33268;&#21147;&#26044;&#28858;&#31038;&#21312;&#30340;&#20491;&#20154;&#65292;&#20013;&#23567;&#20225;&#26989;&#25552;&#20379;&#23560;&#26989;&#30340;&#27861;&#24459;&#26381;&#21209;&#65292;&#20006;&#29992;&#25105;&#20497;&#30340;&#32147;&#39511;&#21332;&#21161;&#20182;&#20497;&#23526;&#29694;&#30456;&#25033;&#30340;&#21830;&#26989;&#30340;&#35380;&#27714;&#20197;&#