('gbeyer@bprlaw.net', NULL, '417 F Street', 'Lincoln', 'California', 'California', '95648', '916-645-9529', '916-645-5550', 'Greg_Beyer.jpg', 'Beyer', '', 'http://www.bprlaw.net', NULL, NULL, 'Beyer, Pongratz & Rosen, a Professional Law Corporation, was first organized in 1991 by two of its founding attorneys, Gregory R. Beyer, Esq, and Stephen G. Pongratz Esq. Mr. Beyer and Mr. Pongratz worked in the same office for 2 years prior to their creation of the current corporation. Etan Rosen joined the firm as it''s first law clerk in 1994 and later became it''s first Associate and eventually a Partner. David Brown joined the firm in 2002. He later became a partner in 2006. The main office of the business is in Sacramento, with a satellite office in Lincoln.\r\n\r\n BPR''s services include Estate Planning, Trusts & Wills, Business Structuring, Corporations, Partnerships, LLCs, Probate, Contracts and Transactional Work, Asset Protection Planning, Medi-Cal Planning, Elder Law Issues, General Business Litigation, Wrongful Termination, Personal Injury, Family Law, Bankruptcy, Dissolution and Child Support, Probate, Criminal Law, Trust Litigation, Real Estate and other areas.\r\n\r\n With close to 25 years of practice, the firm prides itself on it''s quality staff, timely and affordable work, and customer care.\r\n\r\n', 'Chinese Bio Coming Soon', 'Beyer, Pongratz & Rosen, PLC', 'L1049', '', NULL, NULL, 'Gregory R', NULL, 'Sacramento', 'Roseville', 'Elk Grove', 'Loomis', 'Auburn', 'Davis', 'Marysville', 'Yuba City', 'Rancho Cordova', 'Gold River', 'Folsom', 'Placerville', 'Garden Valley', 'Newcastle', 'Rocklin', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '2016-02-16 23:58:32', '2016-02-17 05:19:03'),
