('mark@usworkvisa.com', NULL, '11601 Wilshire Blvd.', 'Los Angeles', 'California', 'California', '90025', '310-477-3000', '310-477-2652', 'Mark_Ivener_3.jpg', 'Ivener', '', 'http://www.eb5investment.com', NULL, NULL, 'For more than 35 years, immigration attorney Mark Ivener has exclusively practiced immigration law. He has lectured on U.S. immigration law, visas and EB-5 investor Green Cards for organizations such as the World Trade Institute; the International, California and Los Angeles Bar Associations; the American Immigration Lawyers Association (AILA); and Immigration Lawyers on the Web (ILW.com).\r\n\r\n His books include EB-5 Visas: International Investors & U.S. Taxes; Handbook of Immigration Law, Volumes I & II; Doing Business in the USA Under Free Trade; Get the Right Visa; A Complete Guide to Getting An American Visa (in Japanese); and Have You Thought About Immigrating to the US? (in Spanish). In addition, he has authored many EB-5 articles for such publications as Offshore Investment Magazine, The Practical Tax Lawyer, Immigrant Magazine, and the California International Law Journal.\r\n\r\n A leader in his field, Mark Ivener is a founder of the National Consortium of Immigration Law Firms (IMMLAW) and the Alliance of Business Immigration Lawyers (ABIL). He is listed in the Martindale-Hubbell Bar Register of Preeminent Lawyers (Immigration and Naturalization), the International Who’s Who of Corporate Immigration Lawyers and Chambers Global and USA.\r\n\r\n Mr. Ivener was the only immigration attorney named in Citywealth Magazine’s Top 100 Wealth Advisors and Managers in the Americas; Attorney Leaders List, the annual guide to the Most Highly Regarded Figures in Private Wealth Management; and North America’s Leading Advisors Top 50.', '&#22914;&#26524;&#20320;&#26159;&#22269;&#22806;&#25237;&#36164;&#32773;,&#26377;&#24847;&#20511;EB-5&#32511;&#21345;&#25237;&#36164;&#32773;&#31243;&#24207;,&#33719;&#21462;&#32654;&#22269;&#27704;&#20037;&#23621;&#30041