('Tonnie@kcmlaw.net', NULL, '1216 South Garfield Avenue', 'Alhambra', 'California', 'California', '91801', '626-308-7860', '626-308-7875', 'Tonnie_Cheng.jpg', 'Cheng', '', 'http://www.kcmlaw.net', NULL, NULL, 'While clients seek out the firm because of its outstanding trial experience and reputation for providing the highest quality legal counsel, they are also assured that KCM will handle their matter in a cost-effective manner at extremely competitive rates.\r\n\r\nThe firm remains true to its origin. It is based in Pasadena, which is a cross-road for business, including the ever-expanding area of Asian markets. The firm also has an office in Alhambra for the convenience of many of its clients from the Asian communities, and the attorneys in that office have special skill and knowledge in family law litigation and immigration issues.\r\n\r\nThe firm''s philosophy of putting clients first guides everything it does.  It recognizes that clients are sophisticated consumers of legal services, and the firm’s commitment to attentive and responsive client service has brought together the resources to examine legal and business issues from every angle.  The firm thus enjoys long-standing client relationships and is proud that clients look to it as a trusted and valued business partner.  Harnessing KCM''s experience to your goals enables you to solve your problems today and tomorrow.\r\n', 'Chinese Bio Coming Soon', 'King Cheng & Miller LLP', 'L1080', 'Suite 102', NULL, NULL, 'Tonnie', NULL, 'Pasadena', 'Monterey Park', 'Los Angeles', 'Arcadia', 'Diamond Bar', '', '', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-04-20 12:59:20', '2016-04-20 17:24:50'),
('mark@markjacobslaw.com', NULL, '5050 Quorum Drive', 'Dallas', 'Texas', 'Texas', '75254', '972-233-7788', '972-960-8241', 'Mark_Jacobs.jpg', 'Jacobs', '', 'http://www.markjacobslaw.com', NULL, NULL, 'Some law firms take any case that comes through the door. At Mark E. Jacobs, P.C., there is a firm focus on family-based immigration. Mark E. Jacobs is there when you face the challenge of detention or removal. He is there when you are ready to take the first steps toward citizenship. He is there to help your family abroad come together here in the U.S. He has successfully brought many couples together to marry. Don''t take on the U.S. government by yourself. Arm yourself with the experience and persistence of one of the most trusted names in Dallas immigration law. Call Mark E. Jacobs at 972-233-7788. Chinese Language Service Available', 'Chinese Bio Coming Soon', 'Mark E. Jacobs, P.C.', 'L1081', 'Suite 140', NULL, NULL, 'Mark E.', NULL, 'Fort Worth', 'Arlington', 'Plano', 'Garland', 'Irving', 'Mesquite', 'Carrollton', 'Richardson', 'Wichita Falls', 'Denton', 'Lewisville', 'McKinney', 'Waco', 'Tyler', 'Frisco', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-04-21 00:25:09', '2016-04-21 05:17:31'),
