('jwang@carterscholer.com', NULL, '8150 N. Central Expressway', 'Dallas', 'Texas', 'Texas', '75206', '214-550-8162', '214-550-8185', 'Jennifer_Wang_2.jpg', 'Wang', '', 'http://www.carterscholer.com', NULL, NULL, 'Jennifer C. Wang is Of Counsel to Carter Scholer Arnett Hamada & Mockler. Jennifer is a commercial litigator with experience in private practice and government. Jennifer has represented corporate and individual clients in litigation including product liability, medical malpractice and other personal injury torts. She also has handled commercial lawsuits involving breach of contract, fraud, misrepresentation, tortious interference, unfair competition, insurance coverage claims and regulatory matters.\r\n\r\nPrior to joining Carter Scholer, Jennifer was an Assistant City Attorney for the City of Dallas where she represented the City in civil litigation matters ranging from constitutional claims to financial disputes, utilities, zoning and land use issues. Immediately after law school, Jennifer served as judicial clerk to the Hon. Sam A. Lindsay in the U.S. District Court for the Northern District of Texas. While in law school, Jennifer clerked for Judge Russell Roden in the Dallas County Court at Law No. 1. Jennifer was also an associate at Carrington, Coleman, Sloman & Blumenthal.\r\n\r\nBefore embarking on her legal career, Jennifer was a journalist, with experience in both print and broadcast journalism. Jennifer was an on-air reporter and anchor for an ABC affiliate in North Carolina prior to joining a CBS affiliate in Orlando, Florida as an on-air reporter and fill-in anchor.\r\n', 'Chinese Bio Coming Soon', 'Carter Scholer Arnett Hamada & Mockler, PLLC', 'L1084', 'Suite 500', NULL, NULL, 'Jennifer C.', NULL, 'Richardson', 'Fort Worth', 'Garland', 'Mesquite', 'Plano', 'Grand Prairie', 'Arlington', 'Carrollton', 'Farmers Branch', 'Irving', 'Denton', 'Frisco', 'Rockwall', 'Greenville', '', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-04-21 13:27:50', '2016-04-21 17:33:28'),
('daniel.zhang@harrygee.com', NULL, '5847 San Felipe', 'Houston', 'Texas', 'Texas', '77057', '713-800-6017', '713-781-2409', 'Daniel_Zhang.jpg', 'Zhang', '', 'http://www.harrygee.com', NULL, NULL, 'Daniel X. Zhang is a board certified specialist in Immigration and Nationality Law by the Texas Board of Legal Specialization. Board Certification is a mark of excellence and a distinguishing accomplishment.\r\n\r\nWithin the Texas legal community, Board Certification means an attorney has substantial, relevant experience in a select field of law as well as demonstrated, and tested, special competence in that area of law. \r\nThere are more than 90,000 attorneys licensed to practice in Texas. Only 7,200 are Board Certified.\r\nFor nearly half a century, Harry Gee & Associates has been at the forefront of the immigration field in Houston. Harry Gee built his firm on the foundation of personal service, strong legal knowledge and creative solutions. The firm upholds these principles today by educating our clients about the realities and intricacies of immigration law. Our client list includes Fortune 100 companies from the energy & medical industries, universities, non-profits, as well as foreign nationals. Our clients utilize our innovative immigration strategies to achieve their immigration objectives. ', 'Chinese Bio Coming Soon', 'Harry Gee & Associates', 'L1085', 'Suite 2950', NULL, NULL, 'Daniel X.', NULL, 'Katy', 'Dallas', 'San Antonio', 'Galveston', 'Austin', 'Corpus Christi', 'Denton', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-04-28 12:46:05', '2016-05-02 03:35:02'),
('mlerner@kleinberglerner.com', NULL, '1875 Century Park East', 'Los Angeles', 'California', 'California', '90067', '310-557-1511', '310-557-1540', 'Marshall_Lerner.jpg', 'Lerner', '', 'http://www.kleinberglerner.com', NULL, NULL, 'Kleinberg & Lerner, LLP works with its clients to identify, protect and maximize their intellectual property assets. Our clients include corporations, partnerships, sole proprietors, entrepreneurs, inventors, designers, and authors.  With decades of experience in intellectual property matters of all types, Kleinberg & Lerner, LLP strives to protect and maintain our client’s intellectual property.  \r\n\r\nSince its inception in 1985, our firm has worked to enable our clients to acquire, license, protect and enforce their intellectual property.  Over that time, our firm has acquired a reputation for outstanding work, above-average counseling and for building strong, long-lasting, mutually beneficial relationships with our clients.  Our attorneys are highly client-focused and strive to provide the best work product and advice to our clients. Mrs. Vivian Wang is an associate attorney at the firm whose practice focuses on all intellectual property matters including patents, trademarks and copyright Laws. She is fluent in Mandarin and Cantonese, and is able to read and write in both Languages. \r\n', 'Chinese Bio Coming Soon', 'Kleinberg & Lerner, LLP', 'L1086', 'Suite 1150', NULL, NULL, 'Marshall A.', NULL, 'Pasadena', 'San Diego', 'Irvine', 'Beverly Hills', 'Santa Ana', 'City of Industry', 'Tustin', 'Ontario', 'San Bernardino', 'Riverside', 'Murrieta', 'Long Beach', 'Newport Beach', 'Burbank', 'Rancho Cucamonga', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-05-04 12:24:06', '2016-05-04 16:41:36'),
('nbs@nbslawyers.com', NULL, '1911 Southwest Freeway', 'Houston', 'Texas', 'Texas', '77098', '713-630-0708', '713-630-0789', 'Newton_Schwartz.jpg', 'Schwartz, Sr.', '', 'http://www.nbslawyers.com', NULL, NULL, 'Newton B. Schwartz, Sr. is the owner of the Law Offices of Newton B. Schwartz, Sr. During his legal career (which spans over fifty years), he has successfully represented clients in a variety of litigation matters including:\r\n• aviation cases;\r\n• admiralty cases; \r\n• antitrust litigation; \r\n• automobile collisions and product liability;\r\n• criminal cases filed in federal court;\r\n• intellectual properties disputes;\r\n• patent applications; and\r\n• toxic tort litigation.\r\nTo most effectively litigate and resolve his clients'' claims, Mr. Schwartz routinely works with attorneys from other law offices located in the United States and around the world. Several staff members are bilingual and speak Chinese in addition to English.', 'Chinese Bio Coming Soon', 'The Law Offices of Newton B. Schwartz, Sr.', 'L1089', '', NULL, NULL, 'Newton B.', NULL, 'Galveston', 'Brownsville', 'Corpus Christi', 'Dallas', 'Fort Worth', 'Austin', 'Lubbock', 'Amarillo', 'Marshall', 'Beaumont', 'Texarkana', 'Tyler', 'Port Arthur', 'Waco', 'Katy', 'USA', NULL, 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-05-11 00:26:27', '2016-06-22 21:41:30'),
