('phu@dalpat.com', NULL, '5420 LBJ Freeway', 'Dallas', 'Texas', 'Texas', '75240', '972-680-6055', '972-479-0464', 'Patricia_Hu.jpg', 'Hu', '', 'http://www.dalpat.com', NULL, NULL, 'Howison & Arnott, L.L.P. is a law firm practicing exclusively in the area of intellectual property, including patents, trademarks, copyrights and unfair competition.\r\n\r\nOur mission is to effectively secure maximum legal protection for our clients’ technologies, brand identities and creative content. We also guide our clients in the development of their intellectual property assets to enhance company value.\r\n\r\nThe firm’s attorneys have expertise in all areas of patent, trademark and copyright law.\r\n\r\nAll partners are registered U.S. Patent Attorneys qualified to practice in the U.S. Patent and Trademark Office. We assist domestic clients in the filing of U.S. and international applications for patents and trademarks, and help our international clients seeking to extend protection into the United States. We also counsel our clients regarding patent ability and trademark availability, prepare infringement and freedom-to-operate opinions, and offer litigation counseling and support services.\r\n', 'Chinese Bio Coming Soon', 'Howison & Arnott, LLP', 'L1091', 'Suite 660', NULL, NULL, 'Patricia', NULL, 'Austin', 'Houston', 'Fort Worth', 'Plano', 'Frisco', 'Richardson', 'Arlington', 'Stafford', 'Carrollton', 'Coppell', 'Garland', 'Bellaire', 'New Territory', 'Round Rock', 'Irving', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-05-11 23:39:29', '2016-05-17 18:11:59'),
('info@mshahlaw.com', NULL, '232 madison Avenue', 'New York', 'New York', 'New York', '10016', '212-233-7473', '', 'Hui_Zeng_2.jpg', 'Zeng', '', 'http://www.mshahlaw.com', NULL, NULL, 'Mona Shah & Associates (MSA) is internationally licensed to practice in the US, China, and the UK. MSA has a diverse client base representing individual, institutional, academic, and corporate clients around the globe. MSA consistently provides creative, high-quality, and cost-effective solutions to legal issues.\r\n\r\n \r\n\r\nA Full Service Law Firm: At MSA, you will find experienced and highly qualified staff to meet your needs and to provide personalized services all of whom are well equipped to address the goals of our clients. Our support staff includes: EB-5 specialists, of-counsel attorneys in highly specialized areas, paralegals and law clerks. Our People’s Republic of China (PRC) qualified attorneys, versed in Chinese culture and language, serve the legal needs of our China-based clients, in matters of corporate, litigation, contract, business, immigration, securities, intellectual property, and U.S. market due diligence. We are proud of our reputation for responsiveness and superior services.\r\n\r\n \r\n\r\nCommunication is Key: We genuinely enjoy our work and seek to share our excitement and talent. We seek to make a difference for our clients and strive to serve the needs of each individual case.\r\n\r\n \r\n', '&#20844;&#21496;&#31616;&#20171; - &#33707;&#23068;&#33678;&#24459;&#24072;&#20107;&#21153;&#25152;\r\n<br><br>\r\n&#33707;&#23068;&#33678;&#24459;&#24072;&#20107;&#21153;&#25152;&#26159;&#19968;&#23478;&#32463;&#39564;&#20016;&#23500;&#30340;&#31227;&#27665;&#24459;&#24072;&#20107;&#21153;&#25152;&#65292;&#21516;&#26102;&#20063;&#31934;&#36890;&#20844;&#21496;&#27861;&#21450;&#35777;&#21048;&#20132;&#26131;&#27861;&#12290;&#24459;&#25152;&#25104;&#31435;&#20110;1997&#24180;&#65292;&#24635;&#37096;&#22352;&#33853;&#20110;&#32654;&#22269;&#32445;&#32422;&#24066;&