('zhangmelinda@gmail.com', NULL, '1046 West Taylor Street', 'San Jose', 'California', 'California', '95126', '408-621-1855', '', 'Melinda_Zhang.jpg', 'Zhang', '', 'http://www.melindazhanglaw.com', NULL, NULL, 'Law Offices of Melinda M. Zhang is dedicated to be a problem solver. We are against conflict creations. We strive to provide you trust and integrity with experience and team work to build you, our client’s success.  The combination of our Law Offices’ attitude, commitment, knowledge and skills sets us apart from competition. We focus on your needs and expectations.  We bring you superior quality and unparalleled support and services.\r\n\r\n Whether you are facing serious legal problems or contemplating a critical decision, the outcome of your choices will be improved by the personal attention of a conscientious consultant who will guide you through to achieve your objectives. \r\n\r\n Please contact Melinda at (408) 621-1855.  Let us know your needs.   We would stand in front of you to fight for your rights and privileges, and empower you at your toughest times. ', '&#24373;&#22818;&#31179;&#24459;&#24107;&#27155; &#33268;&#21147;&#20110;&#29234;&#24744;&#35299;&#27770;&#21839;&#38988;&#12290; &#25105;&#20497;&#21453;&#23565;&#21046;&#36896;&#27798;&#31361;&#12290;&#25105;&#20497;&#30340;&#38750;&#21516;&#23563;&#24120;&#30340;&#35469;&#30495;&#36000;&#36012;&#30340;&#24907;&#24230;&#65292;&#21152;&#19978;&#25104;&#21151;&#30340;&#32147;&#39511;&#65292;&#23092;&#29087;&#30340;&#24037;&#20316;&#25216;&#33021;&#21644;&#22296;&#38538;&#30340;&#21512;&#20316;&#35731;&#25105;&#20497;&#29234;&#23458;&#25142;&#24744;&#24118;&#20358;&#21331;&#36234;&#30340;&#21697;&#36074;&#21644;&#36229;&#32676;&#30340;&#65292;&#35488;&#23526;&#21487;&#20449;&#30340;&#26381;&#21209;&#12290; \r\n\r\n &#28961;&#35542;&#24744;&#38754;&#33256;&#26159;&#22196;&#32901;&#30340;&#27861;&#24459;&#21839;&#38988;&#65292; &#36996;&#26159;&#35201;&#20570;&#20986;&#37325;&#35201;&#30340;&#27770;&#23450;&#65292; &#36984;&#25799;&#19968;&#20491;&#31526;&#21512;&#24744;&#25152;&#38656;&#35201;&#30340;&#24459;&#24107;&#65292; &#19968;&#20491;&#27491;&#30452;&#65292; &#35488;&#23526;&#65292;&#20855;&#26377;&#23560;&#26989;&#27700;&#20934;&#32780;&#21448;&#26377;&#33391;&#24515;&#30340;&#24459;&#24107;&#26371;&#32102;&#24744;&#24118;&#20358;&#20196;&#20154;&#28415;&#24847;&#30340;&#32080;&#26524;&#12290; &#25105;&#20497;&#26371;&#29234;&#24744;&#25171;&#25340;&#65292; &#29229;&#21462;&#24744;&#30340;&#26368;&#39640;&#27402;&#30410;&#65307; &#21516;&#26178;&#25105;&#20497;&#20063;&#26371;&#21161;&#24744;&#24230;&#36942;&#22256;&#38627;&#30340;&#38542;&#27573;&#12290;\r\n\r\n&#35531;&#33287;&#25105;&#20497;&#32879;&#31995;&#65292;&#25765;&#36890;&#25105;&#20497;&#30340;&#20013;&#25991;&#29105;&#32171;&#65292;(408)621-1855&#65292;&#35731;&#25105;&#20497;&#20102;&#35299;&#24744;&#30340;&#38656;&#35201;&#65292; &#24171;&#24744;&#26368;&#22823;&#21487;&#33021;&#22320;&#35299;&#27770;&#21839;&#38988;&#12290; \r\n', 'Law Office of Melinda Zhang', 'L1093', 'Suite 208', NULL, NULL, 'Melinda', NULL, 'San Francisco', 'Fremont', 'Hayward', 'Palo Alto', 'Redwood City', 'San Mateo', 'Newark', 'Oakland', 'Daly City', 'Milpitas', 'Union City', 'Berkeley', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-05-18 14:10:13', '2016-05-18 18:20:42'),
('info@quanlaw.com', NULL, '5444 Westheimer Road', 'Houston', 'Texas', 'Texas', '77056', '713-625-9200', '713-625-9222', 'Gordon_Quan.jpg', 'Quan', '', 'http://www.quanlaw.com', NULL, NULL, 'Quan Law Group (QLG) understands that individuals matter. We know that each immigration case is different and each client’s situation and needs are different; thus, a personalized approach is the optimal strategy for the successful representation of our clients.\r\n\r\n\r\n\r\nQLG has experienced and award-winning attorneys with vast knowledge in all areas of immigration law.  All of QLG’s Founding Partners are Board Certified in Immigration and Nationality Law by the Texas Board of Legal Specialization.\r\n\r\nOur attorneys have received Top Lawyer, Super Lawyer and/or Rising Star designations for their excellence in immigration law, please refer to each attorney’s biography for details.  In addition, our attorneys serve on liaison committees that bring together immigration lawyers with officials working for various U.S. government agencies. Therefore, our attorneys are continually at the forefront of immigration developments and are poised to use this knowledge to benefit our clients.\r\n\r\n\r\n\r\nQLG’s clients include individuals, families, professionals, investors, as well as companies who employ foreign nationals from every continent.  QLG assists U.S. Citizens and permanent residents with filing immigrant petitions for their family members. We also help immigrants navigate our complex immigration system to apply for various forms of benefits that they are eligible for.  QLG’s corporate clients include domestic and foreign multi-national companies as well as small and mid-size enterprises interested in sponsoring foreign nationals for temporary work visas and permanent resident status. Our client companies do business in a wide variety of fields including:  Oil & Gas, Engineering, Banking & Investment, Consulting, Computer Technology & High Tech Industries, Healthcare, Education, Retail & Manufacturing, Hotels & Restaurants, and Professional Sports & Entertainment, among other fields. We also represent individual investors in obtaining temporary visas and permanent residence.\r\n', 'Chinese Bio Coming Soon', 'Quan Law Group, PLLC', 'L1095', 'Suite 1750', NULL, NULL, 'Gordon J.', NULL, 'Katy', 'Sugar Land', 'Galveston', 'The Woodlands', '', '', '', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-05-25 13:54:55', '2016-05-25 18:08:01'),
