('laurie@lywlaw.com', NULL, '', '', 'California', 'California', '', '732-387-3668', '', 'Laurie_Wu.jpg', 'Wu', '', 'http://www.fiancee-visa-attorney.com', NULL, NULL, 'Laurie’s practice primarily focuses on family-based immigration cases.  With the personal nature of each case, she provides each client with the utmost personal attention.  Clients have direct and ongoing contact with her until the completion of each case.  She is responsive and reachable, typically responding the same day or following day.\r\n\r\nLaurie strives to minimize her clients’ anxieties throughout the immigration process and guides them through each step of the process.  Before each interview, she personally prepares clients via telephone or Skype. We engage with foreign consultants in countries such as China and Ukraine for guidance on local procedures (e.g., obtaining country-specific documents) and for general client assistance (e.g., organizing interview documents and contacting medical clinics). \r\n\r\nNavigating through any immigration case is often an emotional and costly process.  We hope that no client is prevented from using our services because of our fee.  We try to accommodate the needs of our clients by offering payment plans, partial-service options, and pro bono service.\r\n', '&#20237;&#29577;&#20202;&#24459;&#24072;&#20986;&#29983;&#22312;&#32654;&#22269;&#26032;&#27901;&#35199;&#24030;&#12289;&#29238;&#27597;&#26159;&#20013;&#22269;&#22823;&#38470;&#21326;&#20392;&#12290;&#22905;&#29087;&#24713;&#24191;&#19996;&#35805;&#12289;&#23458;&#23478;&#35805;&#21644;&#26222;&#36890;&#35805;&#12290;&#22312;2003&#24180;&#12289;&#20237;&#24459;&#24072;&#27605;&#19994;&#20110;&#26032;&#27901;&#35199;&#24030;&#30340;&#24503;&#40065;&#22823;&#23398;&#12290;&#22905;&#20197;&#26368;&#20248;&#31561;&#30340;&#23398;&#29983;&#27605;&#19994;&#12289;&#19977;&#24180;&#20043;&#20869;&#23436;&#25104;&#20102;&#22235;&#24180;&#30340;&#32463;&#27982;&#23398;&#23398;&#20301;&#12290;&#21435;&#27861;&#