('contact@alsnorthwest.com', NULL, '8113 W. Quinault Avenue', 'Kennewick', 'Washington', 'Washington', '99336', '509-851-7884', '', 'Patrick_Galloway_-_Group_pic_2.jpg', 'Galloway', '', 'http://www.alsnorthwest.com', NULL, NULL, 'Regardless of the legal issues you’re facing, you can rely on the one firm that can handle it all – Advance Legal Services. With a broad range of legal experience, our attorneys can assist you with criminal defense, DUI cases, probate-wills-Trusts, Family Law, Personal Injury, and business law. Our professionals will work hard to get you the best possible outcome. The lawyers at Advance Legal Services understand how frustrating and frightening the legal system can be. Gain the confidence you need by having our team of professionals by your side every step of the way. \r\n\r\nWe take pride in advising you about what’s in your best interest and in keeping you fully informed throughout the entire proceeding. \r\n\r\nPut an experienced legal professional in your corner by calling Advance Legal Services today.', 'Chinese Bio Coming Soon', 'Advance Legal Services, PLLC', 'L1122', 'Suite 101', NULL, NULL, 'Patrick J.', NULL, 'Pasco', 'Richland', 'Walla Walla', 'Spokane', 'Yakima', '', '', '', '', '', '', '', '', '', '', 'USA', NULL, 'Y', 'Y', 'Y', '', 'Y', 'Y', 'Y', 'Y', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-09-22 01:22:57', '2016-09-22 05:51:33'),
('oshanlegal@gmail.com', NULL, 'P.O. Box 9091', 'Seattle', 'Washington', 'Washington', '98109', '206-335-3880', '206-905-0918', 'Evan_Oshan.jpg', 'Oshan', '', 'http://www.oshanandassociates.com', NULL, NULL, 'Evan Oshan knew he wanted to be an attorney since he was eight years old.  Oshan began to perfect his advocacy skills throughout College as a member and coach of U.C.L.A.''s Champion National Debate Team.  It was also during this time that he served as a United States Senatorial Intern in Washington D.C.\r\n\r\n\r\n \r\n\r\n\r\nOshan graduated Cum Laude from the University of California Los Angeles (UCLA).  He went on to earn his Juris Doctorate degree from the University of Califonia Hastings College of The Law, the first law school of the Univesity of Califonia; where he excelled in trial advocacy.  \r\n\r\n\r\n \r\n\r\n\r\nOshan served as an international law intern while serving as an intern at the United Nations High Commission for Refugees in Geneva, Switzerland.\r\n\r\n\r\n \r\n\r\n\r\nIn 2000 Oshan & Associates, P.C. was formed with the goal of providing aggressive, diligent, and honest legal representation. Also in 2000 Oshan was a member of Vice President Gore''s National Advance Team where he traveled throughout the United States.\r\n', 'Chinese Bio Coming Soon', 'Oshan & Associates, P.C.', 'L1123', '', NULL, NULL, 'Evan', NULL, 'Tacoma', 'Everett', 'Federal Way', 'Kennewick', 'Kent', 'Olympia', 'Vancouver', 'Yakima', 'Des Moines', 'Renton', 'Bothell', 'Kirkland', 'Spokane', 'Redmond', 'Richland', 'USA', NULL, 'Y', 'Y', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '2016-09-28 12:12:37', '2016-09-28 17:47:13'),
