('drewby225@gmail.com', NULL, '92 Bayard Street', 'New Brunswick', 'New Jersey', 'New Jersey', '08901', '732-709-3446', '732-626-6557', 'Andrew_Wu_-_Logo.jpg', 'Wu', '', 'http://www.wuhunglaw.com', NULL, NULL, 'Wu & Hung Law, LLC is a full-service law firm dedicated to providing top level legal representation to its clients. Founded in 2012 by Andrew Wu and Selena Hung, the firm represents both individuals and businesses primarily in the areas of real estate, immigration, corporate/business law, trusts and estates, bankruptcy, and workers’ compensation. \r\n\r\nWith offices in New Brunswick and Woodcliff Lake, NJ as well as an immigration branch office in Philadelphia, PA, Wu & Hung Law strives to serve the legal needs of the diverse populations of Middlesex, Bergen, and the surrounding counties. As the American-born children of immigrant parents, both Andrew and Selena thoroughly understand the challenges navigating the American legal system may present to clients of different cultural backgrounds. What also sets us apart from other attorneys is our emphasis on client service and our personal investment in the needs of our clients. It is our number one priority to see to it that our clients’ matters are successfully concluded to the best of our abilities. \r\n\r\nAt Wu & Hung Law, we are professional yet enthusiastic, and fully experienced in the matters of litigation and mediation. Moreover, our staff can speak English, Spanish and Chinese. We welcome you to contact us at any time to discuss how Wu & Hung Law can help you with your legal needs.', 'Chinese Bio Coming Soon', 'Wu & Hung Law, LLC', 'L1125', 'Suite 104', NULL, NULL, 'Andrew', NULL, 'East Brunswick', 'Highland Park', 'Hoboken', 'Jersey City', 'Fort Lee', 'Cherry Hill', 'Camden', 'Edison', 'South Brunswick', 'Somerset', 'Clifton', 'Parsippany', 'Mount Laurel', 'Harrison', 'Cliffside Park', 'USA', NULL, '', '', '', '', '', 'Y', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', 