('shilligthomas@outlook.com', NULL, '3040 Ward Street', 'Vidor', 'Texas', 'Texas', '77662', '409-422-0484', '', 'Thomas_Shillig_2.jpg', 'Shillig', '', 'http://www.shilliglaw.com', NULL, NULL, 'Jacob Thomas Shillig has been involved in supporting individuals and companies in Chile, China, Canada and America in achieving their personal and business goals since 2001. He is fluent in Mandarin-Chinese, Spanish, and English, and takes every opportunity to communicate with others in whichever language they feel most comfortable.\r\n\r\nAttorney Shillig worked doing transcriptions and translations for court purposes for 5 years. During that time he became quite fluent in Spanish and Chinese, and more familiar with the American legal system. He was simultaneously able to get his Associate’s degree in Chinese from the Defense Language Institute, and his Bachelor’s degree in Spanish from Brigham Young University.\r\n\r\nAfter working with American courts he decided to go to law school at night and worked during the day time as a property manager. He especially enjoyed property management because many of the property owners were Chinese and many of the tenants and maintenance workers were Spanish speakers, so everyday Attorney Shillig got to facilitate communication between the owners and tenants of the properties he managed.\r\n\r\nIn the summer of 2013 Attorney Shillig qualified to attend a study abroad program at East China University of Political Science and Law in Shanghai, China. While studying in China he gained a broad understanding of the Chinese legal system, and when he returned to America he focused his legal studies on: Immigration, Federal Income Tax, Property, and International Business Law.\r\n\r\nOn August 1st, 2014 Attorney Shillig graduated from Florida A&M University College of Law as a Juris Doctor. Since then he has been helping individuals from all over the world to realize their dreams of living, working, investing, or going to school in America.\r\n', 'Chinese Bio Coming Soon', 'Shillig Law', 'L1127', '', NULL, NULL, 'Jacob Thomas', NULL, 'Beaumont', 'Austin', 'Houston', 'Dallas', 'Fort Worth', 'Plano', 'San Antonio', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-10-10 23:53:39', '2016-10-27 19:15:47'),
('shilligthomas@outlook.com', NULL, '', '', 'California', 'California', '', '409-422-0484', '', 'Thomas_Shillig_2.jpg', 'Shillig', '', 'http://www.shilliglaw.com', NULL, NULL, ' Jacob Thomas Shillig has been involved in supporting individuals and companies in Chile, China, Canada and America in achieving their personal and business goals since 2001. He is fluent in Mandarin-Chinese, Spanish, and English, and takes every opportunity to communicate with others in whichever language they feel most comfortable. Attorney Shillig worked doing transcriptions and translations for court purposes for 5 years. During that time he became quite fluent in Spanish and Chinese, and more familiar with the American legal system. He was simultaneously able to get his Associate&#65533;s degree in Chinese from the Defense Language Institute, and his Bachelor&#65533;s degree in Spanish from Brigham Young University. After working with American courts he decided to go to law school at night and worked during the day time as a property manager. He especially enjoyed property management because many of the property owners were Chinese and many of the tenants and maintenance workers were Spanish speakers, so everyday Attorney Shillig got to facilitate communication between the owners and tenants of the properties he managed. In the summer of 2013 Attorney Shillig qualified to attend a study abroad program at East China University of Political Science and Law in Shanghai, China. While studying in China he gained a broad understanding of the Chinese legal system, and when he returned to America he focused his legal studies on: Immigration, Federal Income Tax, Property, and International Business Law. On August 1st, 2014 Attorney Shillig graduated from Florida A&M University College of Law as a Juris Doctor. Since then he has been helping individuals from all over the world to realize their dreams of living, working, investing, or going to school in America. \r\n', 'Chinese Bio Coming Soon', 'Shillig Law', 'L1128', '', NULL, NULL, 'Jacob Thomas', NULL, 'Los Angeles', 'San Francisco', 'Irvine', 'Palo Alto', 'San Diego', 'Pasadena', 'Oakland', 'Rowland Heights', 'Santa Ana', 'Monterey Park', 'Hacienda Heights', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-10-11 00:14:43', '2016-10-11 04:22:32');
