('shilligthomas@outlook.com', NULL, '', '', 'Washington', 'Washington', '', '409-422-0484', '', 'Thomas_Shillig_2.jpg', 'Shillig', '', 'http://www.shilliglaw.com', NULL, NULL, ' Jacob Thomas Shillig has been involved in supporting individuals and companies in Chile, China, Canada and America in achieving their personal and business goals since 2001. He is fluent in Mandarin-Chinese, Spanish, and English, and takes every opportunity to communicate with others in whichever language they feel most comfortable. Attorney Shillig worked doing transcriptions and translations for court purposes for 5 years. During that time he became quite fluent in Spanish and Chinese, and more familiar with the American legal system. He was simultaneously able to get his Associate&#65533;s degree in Chinese from the Defense Language Institute, and his Bachelor&#65533;s degree in Spanish from Brigham Young University. After working with American courts he decided to go to law school at night and worked during the day time as a property manager. He especially enjoyed property management because many of the property owners were Chinese and many of the tenants and maintenance workers were Spanish speakers, so everyday Attorney Shillig got to facilitate communication between the owners and tenants of the properties he managed. In the summer of 2013 Attorney Shillig qualified to attend a study abroad program at East China University of Political Science and Law in Shanghai, China. While studying in China he gained a broad understanding of the Chinese legal system, and when he returned to America he focused his legal studies on: Immigration, Federal Income Tax, Property, and International Business Law. On August 1st, 2014 Attorney Shillig graduated from Florida A&M University College of Law as a Juris Doctor. Since then he has been helping individuals from all over the world to realize their dreams of living, working, investing, or going to school in America. \r\n', 'Chinese Bio Coming Soon', 'Shillig Law', 'L1129', '', NULL, NULL, 'Jacob Thomas', NULL, 'Seattle', 'Tacoma', 'Everett', 'Mercer Island', 'Bellevue', 'Yakima', 'Spokane', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2016-10-11 00:23:25', '2016-10-11 04:26:24'),
('s.ouya@mainalaw.com', NULL, '2140 Shattuck Avenue', 'Berkeley', 'California', 'California', '94704', '415-391-6612', '', 'Sam_Maina.jpg', 'Maina', '', 'http://www.mainalaw.com', NULL, NULL, 'At the Law Offices of S. Ouya Maina, we know what it is like to go through the immigration process.\r\n\r\nMost of the people working in our firm are either first- or second-generation Americans or naturalized U.S. citizens. Our understanding of immigration law-and of our clients’ needs-is both professional and personal.\r\nWe are straightforward. We do not make promises we cannot keep, and we do not charge for services we cannot deliver. We work with U.S. citizens, non U.S. citizens, and legal and illegal immigrants. At the Law Offices of S. Ouya Maina, we help individuals and families in California who are seeking to gain or maintain proper legal status in the United States. In addition, we have extensive experience in asylum offices throughout the United States and in U.S. consular posts abroad.\r\n\r\nWhether you need an immigration lawyer for something simple or complex, please E-mail or call today and tell us about your situation. At the Law Offices of S. Ouya Maina, we know what to do because we focus on immigration law.\r\n', '&#22312;S.&#27431;&#38597;&#40614;&#32435;&#30340;&#24459;&#24072;&#20107;&#21153;&#25152;&#65292;&#25105;&#20204;&#30693;&#36947;&#23427;&#26159;&#20160;&#20040;&#26679;&#35201;&#32463;&#36807;&#31227;&#27665;&#36807;&#31243;&#12290;\r\n<br><br>\r\n&#22823;&#22810;&#25968;&#22312;&#25105;&#20204;&#20844;&#21496;&#24037;&#20316;&#30340;&#20154;&#35201;&#20040;&#26159;&#31532;&#19968;&#25110;&#31532;&#20108;&#20195;&#31227;&#27665;&#25110;&#24402;&#32654;&#22269;&#20844;&#27665;&#12290; &#25105;&#20204;&#30340;&#31227;&#27665;&#27861;&#30340;&#29702;&#35299;&#21644;&#25105;&#20204;&#30340;&#23458;&#25143;&#30340;&#38656;&#27714;&#65292;&#26159;&#19987;&#19994;&#21644;&#20010;&#20154;&#12290;\r\n<br><br>\r\n&#22312;S.&#27431;&#38597;&#40614;&#32435