('alfarkaslaw@gmail.com', NULL, '6200 Chase Oaks Blvd', 'Plano', 'Texas', 'Texas', '75023', '972-423-9393', '972-424-1636', 'Andrew_Farkas.jpg', 'Farkas', '', 'http://www.andrewlfarkaslaw.com', NULL, NULL, 'You are here because you need a lawyer.\r\n\r\n\r\n\r\n\r\nAndrew is your gladiator!  \r\n\r\n\r\n\r\n\r\nAndrew L. Farkas, Attorney at Law is a trial lawyer serving clients throughout Plano, TX and the surrounding areas. Whether you need a criminal defense lawyer for your felony or misdemeanor charges, a personal injury or family attorney, Andrew will fight by your side every step of the way to protect your rights and ensure you get the best possible results for your case.\r\n\r\n\r\n\r\n\r\nWhen your freedom, reputation, or your rights are at stake, you need someone willing to fight for you, someone who is not afraid to battle in court, and someone who has earned the respect of judges, prosecutors, and opposing counsel in literally thousands of cases.', 'Chinese Bio Coming Soon', 'Andrew L. Farkas Attorney at Law', 'L1132', 'Suite 102B', NULL, NULL, 'Andrew L. ', NULL, 'Allen', 'Richardson', 'McKinney', 'Frisco', '', '', '', '', '', '', '', '', '', '', '', 'USA', NULL, 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-11-01 23:48:17', '2016-11-02 03:58:30'),
('barbara@marcouillerlaw.com', NULL, '12356 Northup Way', 'Bellevue', 'Washington', 'select state', '98005', '425-702-0616', '', 'Barbara_Marcouiller_2.jpg', 'Marcouiller', '', 'http://www.marcouillerlaw.com', NULL, NULL, 'Dedicated exclusively to questions of immigration and nationality law for 23 years, and with a background in international business, we un-complicate U.S. immigration for American and international businesses, unite families, and pull it all together. \r\n\r\nFrom our very conveniently located office in north Bellevue, we assist and advocate for clients in Redmond, Bellevue, Kirkland, Seattle, and beyond, in fact worldwide, and at every level from USCIS and the Department of State, all the way up to and including the federal court of appeals. The majority of our clients are from Europe, Canada, Australia, and Asia, though we have helped clients from nearly every continent.\r\n', 'Chinese Bio Coming Soon', 'The Law Office of Barbara A. Marcouiller, P.S.', 'L1133', 'Suite D', NULL, NULL, 'Barbara', NULL, 'Seattle', 'Everett', 'Tacoma', 'Wenatchee', 'Lynnwood', 'Auburn', 'Federal Way', 'Kent', 'Redmond', 'Kirkland', 'Bremerton', 'Mount Vernon', 'Walla walla', 'Yakima', 'Aberdeen', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-01-13 10:55:59', '2017-01-13 16:06:23'),
('info@visatopia.com', NULL, '8 Corporate Park', 'Irvine', 'California', 'California', '92606', '949-250-1688', '', 'Deacon_Zhang.jpg', 'Zhang', '', 'http://www.visatopia.com', NULL, NULL, 'We are a team with exceptional experience in handling employment-based and business-oriented immigration matters. We have two offices in Southern California: one located in Arcadia of Los Angeles County and the other one in Irvine of Orange County. We are deeply rooted in Southern California, but we serve a diverse clientele throughout the U.S. and the world in resolving their complex immigration matters. Our dedicated and attentive team has over a decade of experience in dealing with a wide variety of immigration issues and is intimately familiar with the challenges foreigners often face in pursuing the American Dream.\r\n\r\nAs manifested in our mission statement, we strive to handle our clients’ immigration matters with the utmost integrity, care, and professionalism. With a 95% approval rate and nearly a decade of experience in employment-based and business-oriented immigration issues, we are deeply committed to helping our clients obtain the best possible results every step of the way on their journey to achieving the American Dream.\r\n', 'Chinese Bio Coming Soon', 'Law Offices of Deacon Zhang, P.C.', 'L1134', 'Suite 230', NULL, NULL, 'Deacon', NULL, 'Los Angeles', 'Arcadia', 'Pasadena', 'San Gabriel', 'Rosemead', 'Rowland Heights', 'City of Industry', 'San Francisco', 'San Diego', 'Mountain View', 'Rancho Cucamonga', 'Long Beach', 'Palo Alto', 'Palo Verde', 'Yorba Linda', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '2017-01-22 17:51:08', '2017-01-22 23:08:57'),
('manager.v@houstondivorcenow.com', NULL, '1305 Prairie Street', 'Houston', 'Texas', 'Texas', '77002', '832-632-4639', '281-724-5063', 'Daniel_Lee_-_Final.jpg', 'Lee', '', 'http://www.leelegalgroup.com', NULL, NULL, 'It’s all about the client’s best interest for Daniel Lee. With more than nine years of trial experience in commercial litigation, personal injury and family law, Lee is strategically positioned to create a vantage point for his every case. He strives to lower his client’s stress level not only with competent representation, but also with a compassionate approach to a highly emotional situation. \r\n\r\nNot your typical family law attorney, Lee is also a real estate investor and \r\n\r\na successful restaurateur. He utilizes his business acumen in applying a successful formula to all his cases and to anticipate issues business owners face in a divorce. No matter how complex or contentious your divorce, child custody or child support case, Lee always works hard to obtain the best results in negotiations and in the courtroom. Attorney Lee was awarded Houston Top Lawyer in 2017- H Magazine\r\n', 'Chinese Bio Coming Soon', 'C.Y. Lee Legal Group', 'L1135', 'Suite 300', NULL, NULL, 'Daniel', NULL, 'Spring', 'Pearland', 'Sugar Land', 'Katy', 'The Woodlands', 'Galveston', 'Bellaire', 'Conroe', 'Sealy', 'Plano', 'Baytown', 'Fulshear', 'Richmond', 'Rosenberg', '', 'USA', NULL, '', 'Y', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-01-24 10:44:01', '2017-01-24 20:12:51'),
('lisaliu@mitzelgroup.com', NULL, '44 Montgomery Street', 'San Francisco', 'California', 'California', '94104', '415-813-4981', '415-735-3572', 'Lisa_Liu.jpg', 'Liu', '', 'http://www.mitzelgroup.com', NULL, NULL, 'Lisa W. Liu is an attorney who specializes in business law and immigration law. Lisa works with her clients to build and protect their businesses as she guides her clients through their distinct legal issues. It is Lisa’s uniquely intersecting background of business and law, as well as her own experience with immigration, which allows her to approach her clients with such understanding and creative options to help them achieve their business goals', 'Chinese Bio Coming Soon', 'The Mitzel Group', 'L1136', 'Suite 1660', NULL, NULL, 'Lisa W.', NULL, 'Menlo Park', 'Fremont', 'San Jose', 'Los Angeles', 'Rowland Heights', 'Hayward', 'San Mateo', '', '', '', '', '', '', '', '', 'USA', NULL, '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-01-24 11:04:23', '2017-01-24 16:11:49'),
('mmetcalf1@hotmail.com', NULL, '10000 N. Central Expressway', 'Dallas', 'Texas', 'Texas', '75231', '214-890-9270', '214-340-9836', 'Mike_Metcalf.jpg', 'Metcalf', '', 'http://www.metcalfmediation.com', NULL, NULL, 'Michael P. “Mike” Metcalf doing business as Metcalf Mediation & Arbitration Services is engaged in the practice of law that centers on the mediation and arbitration of civil disputes. Judge Metcalf has more than 40 years of legal experience that includes service in the United States Army Judge Advocate General’s Corp, as a District Attorney, District Judge and trial lawyer. Mike, a trial lawyer, is board-certified by the Texas Board of Legal Specialization in Civil Trial Law and Personal Injury Trial Law.', 'Chinese Bio Coming Soon', 'Metcalf Mediation & Arbitration Services', 'L1138', 'Suite 400', NULL, NULL, 'Michael P.', NULL, 'Fort Worth', 'Houston', 'Austin', 'San Antonio', 'Tyler', 'Galveston', 'Lubbock', 'Amarillo', 'Abilene', 'El Paso', 'Beaumont', 'Longview', 'Corpus Christi', 'Harlingen', 'Bryan', 'USA', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-01-31 11:25:53', '2017-02-09 23:04:39'),
('pi.matsonlaw@gmail.com', NULL, '301 E Colorado Blvd', 'Pasadena', 'California', 'California', '91101', '626-888-3665', '', 'Don_Matson.jpg', 'Matson', '', 'http://www.matsoninjurylaw.com', NULL, NULL, '\r\nI’m Donald J. Matson (you can call me Don) founding attorney of the firm. First off, I want to say how sorry I am that you are going through such a difficult time. I became a lawyer because I wanted to help people like you regain their financial footing after unfortunate occurrences in their lives. \r\n\r\nMy job is to alleviate some of your worry and anxiety — let me deal with the insurance company. I’ve been playing hardball with them for over 10 years and have gotten great results for my clients. As your advocate, I will fight for your rights so you can concentrate on your recovery.\r\n\r\nCall me today at (626) 792-1900 for a free, no obligation consultation!', 'Chinese Bio Coming Soon', 'The Law Offices of Donald J. Matson', 'L1139', 'Suite 325', NULL, NULL, 'Donald J.', NULL, 'Rosemead', 'San Gabriel', 'Alhambra', 'Monterey Park', 'San Marino', 'Los Angeles', 'Glendale', 'Burbank', 'South Pasadena', 'El Monte', 'Temple City', 'Rowland Heights', 'Downey', 'West Covina', 'Altadena', 'USA', NULL, 'Y', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-02-01 10:53:19', '2017-02-01 16:14:54'),
